import React from "react";
import "./Cards.css";
import CardItem from "./CardItem";
import JSONDATA from "../Games.json";

function Cards() {
  return (
    JSONDATA.map((val) => {
      <CardItem
        src={val.Image}
        text="THIS IS A TEST"
        label={val.Genre}
        path="/"
      />;
    })

  );
}

export default Cards;
